  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Northwest
  Montana WMD outlines Refuge accomplishments during the 1994 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, volunteer programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, croplands, grasslands, grazing, haying, fire management,
  pest control, and water rights. The wildlife section of the report discusses endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, animal control, and marking and bird banding.
  The public uses of the Refuge described in this report include hunting, fishing,
  trapping, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, and equipment replacement\",\n\t\"owner_org\":
